var File = function(id, size)
{
  this.id = id;
  this.size = size;
};

var FastArray = function(threshold)
{
    this.threshold = threshold;
              
    this.map = [];
    this.buckets = [];

    this.leaps = [];
};

FastArray.prototype.addLeap = function(index, leap)
{
    this.leaps[index] = leap;
};

FastArray.prototype.addFirstValue = function(length, ID, value)
{
    this.addLeap(length, ID);
        
    var index = this.hash(0, 0);

    var bucket = [];
    bucket[index] = [value];

    this.map[length] = bucket;
};

FastArray.prototype.addNextValue = function(length, ID, value)
{
    var position = (length - 1) | 0;
    var last = this.leaps[position];

    var index = this.hash(ID, last);

    var bucket = this.map[position][index];

    if(bucket == undefined)
    {
        this.map[position][index] = [value];
    }
    else
    {
        bucket[bucket.length] = value;
    }
};

FastArray.prototype.set = function(value)
{
    var ID = value.id;
        
    var length = this.leaps.length;
    
    if(!length || (this.leaps[(length - 1) | 0] + this.threshold) < ID)
    {
        this.addFirstValue(length, ID, value);
    }
    else
    {
        this.addNextValue(length, ID, value);
    }    
};

FastArray.prototype.get = function(ID)
{    
    var valpos = this.getLeapInfoFromID(ID);
    
    var bucket = this.map[valpos[1]][this.hash(ID, valpos[0])];
    var length = bucket.length;
    
    if(length)
    {
        return bucket[0];
    }
    else
    {
       var position = 0;
    
        while(position < length)
        {
            var slot = bucket[position];

            if(slot.id == ID)
            {
                return slot;
            }

            position++;
        }    
    }
    
    return 0;
};

FastArray.prototype.getLeapInfoFromID = function(ID)
{
    var length = this.leaps.length;
    var position = 0;
    
    while(position < length)
    {
        var leap = this.leaps[position];
        
        if(((ID - leap) | 0) <= this.threshold)
        {
            return [leap, position];
        }
        
        position++;
    }
    
    return [-1, -1];
};

FastArray.prototype.hash = function(ID, leap)
{
    return (ID - leap) | 0;
};

function getRandomInt(min, max) 
{
    return Math.floor(Math.random() * (max - min + 1)) + min;
}

function generateFilesFromArray(array, count)
{
    var result = [];

    var i = 0;

    while( i < count )
    {      
        result.push(new File(array[i], getRandomInt(1, 9999999999)));

        i++;
    }

    return result;
}

function mapFromArray(array)
{
    var map = new Map();
    
    var i = 0;
    var length = array.length;
    
    while(i < length)
    {
        map.set(array[i].id, [array[i].id, array[i].size]);
        
        i++;
    }
    
    return map;
}

function fastArrayFromArray(array, threshold)
{
    var fastArray = new FastArray(threshold);
    
    var length = array.length;
    var position = 0;
    
    while(position < length)
    {        
        fastArray.set(array[position]);
        
        position++;
    }
    
    return fastArray;
}

function searchPlainArray(array, ID)
{    
    var length = array.length;
    var iteration = 0;
    
    while(iteration < length)
    {
        var slot = array[iteration];

        if(slot.id == ID)
        {
            return slot;
        }
        
        iteration++;
    }
    
    return null;
}

function midpoint(val1, val2)
{
    return Math.round((val1 + val2)/2);
}

function binarySearchPlainArray(array, ID)
{    
    var imin = 0;
    var imax = array.length - 1;
    
    while(imin <= imax)
    {
        var imid = Math.round((imin + imax)/2);
        
        var slot = array[imid];
        
        if(slot.id == ID)
        {
            return slot;
        }
        else if(slot.id < ID)
        {
            imin = imid + 1;
        }
        else
        {
            imax = imid - 1;
        }
    }
    
    return -1;
}

function testPlainArray(plainArray, searchSet)
{
    var result = [];
    
    var length = searchSet.length;
    var iteration = 0;
    
    while(iteration < length)
    {
        result.push(searchPlainArray(plainArray, searchSet[iteration]));
        iteration++;
    }
    
    return result;
}

function testBinaryPlainArray(plainArray, searchSet)
{
    var result = [];
    
    var length = searchSet.length;
    var iteration = 0;
    
    while(iteration < length)
    {
        result.push(binarySearchPlainArray(plainArray, searchSet[iteration]));
        iteration++;
    }
    
    return result;    
}

function testFastArray(fastArray, searchSet)
{
    var result = [];
    
    var length = searchSet.length;
    var iteration = 0;
    
    while(iteration < length)
    {
        result.push(fastArray.get(searchSet[iteration]));
        iteration++;
    }
    
    return result;   
}

